// Importation des bibliothèques nécessaires
const chai = require('chai');
const expect = chai.expect;
const supertest = require('supertest');

// Importation de votre application Express
const app = require('../server.js'); // Ajustez le chemin selon la structure de votre projet

const request = supertest(app);

describe('API Test Suite', function() {
    it('Step 1: Create a User', function(done) {
        request.post('/api/auth/register')
            .send({
                name: "userTest",
                email: "mailTest@hotmail.fr",
                password: "passwordTest"
            })
            .expect(200)
            .end(function(err, res) {
                expect(res.body).to.have.property('id');
                done(err);
            });
    });

    it('Step 2: Update a User', function(done) {
        // Supposons que "65d4b3d0e6ae0f772c54f2c2" est l'ID d'un utilisateur déjà existant
        request.put('/api/auth/users/65d4b3d0e6ae0f772c54f2c2')
            .send({
                name: "userTestUpdated",
                email: "mailTestUpdate@hotmail.fr",
                password: "passwordTestNew"
            })
            .expect(200, done);
    });

    it('Step 3: Delete a User', function(done) {
        // Supposons que "65d4b3d0e6ae0f772c54f2c8" est l'ID d'un utilisateur déjà existant
        request.delete('/api/auth/users/65d4b3d0e6ae0f772c54f2c8')
            .expect(200, done);
    });

    it('Step 4: Create a Catway', function(done) {
        request.post('/api/catways/')
            .send({
                catwayNumber: "12",
                type: "long",
                catwayState: "clean"
            })
            .expect(200)
            .end(function(err, res) {
                expect(res.body).to.have.property('id');
                done(err);
            });
    });

    it('Step 5: Update a Catway', function(done) {
        // Supposons que "65d4b77569c4ff7b8dc2ecec" est l'ID d'un catway déjà existant
        request.put('/api/catways/65d4b77569c4ff7b8dc2ecec')
            .send({ catwayState: "testClean" })
            .expect(200, done);
    });

    it('Step 6: Delete a Catway', function(done) {
        // Supposons que "65d4b77b69c4ff7b8dc2ecee" est l'ID d'un catway déjà existant
        request.delete('/api/catways/65d4b77b69c4ff7b8dc2ecee')
            .expect(200, done);
    });

    it('Step 7: Get Catway Details', function(done) {
        // Supposons que "65d4b77569c4ff7b8dc2ecec" est l'ID d'un catway déjà existant
        request.get('/api/catways/65d4b77569c4ff7b8dc2ecec')
            .expect(200)
            .end(function(err, res) {
                expect(res.body).to.have.property('catwayNumber', '12');
                done(err);
            });
    });

    it('Step 8: Create a Reservation', function(done) {
        // Cette étape suppose que vous devez d'abord obtenir un ID de catway valide pour créer une réservation
        // Ici, nous utilisons "1" comme exemple simplifié
        request.post('/api/reservations/')
            .send({
                catwayNumber: "1",
                clientName: "alix",
                boatName: "boatTest",
                checkIn: "2023-01-01",
                checkOut: "2023-01-07"
            })
            .expect(200)
            .end(function(err, res) {
                expect(res.body).to.have.property('id');
                done(err);
            });
    });

    it('Step 9: Get Reservation Details', function(done) {
        // Supposons que "65d4b8e569c4ff7b8dc2ecf4" est l'ID d'une réservation déjà existante
        request.get('/api/reservations/65d4b8e569c4ff7b8dc2ecf4')
            .expect(200)
            .end(function(err, res) {
                expect(res.body).to.have.property('clientName', 'alix');
                done(err);
            });
    });

    it('Step 10: Delete a Reservation', function(done) {
        // Supposons que "65d4b92669c4ff7b8dc2ecfa" est l'ID d'une réservation déjà existante
        request.delete('/api/reservations/65d4b92669c4ff7b8dc2ecfa')
            .expect(200, done);
    });
});

