sourcesContent:
const mongoose = require("mongoose");

const reservationSchema = new mongoose.Schema(
  {
    catway: {
      type: mongoose.Schema.Types.ObjectId,
      ref: "Catway",
      required: true,
    },
    clientName: {
      type: String,
      required: true,
    },
    boatName: {
      type: String,
      required: true,
    },
    checkIn: {
      type: Date,
      required: true,
    },
    checkOut: {
      type: Date,
      required: true,
    },
  },
  { timestamps: true }
);

const Reservation = mongoose.model("Reservation", reservationSchema);

module.exports = Reservation;

