// Importation dynamique de Chai au début du fichier
const { expect } = await import('chai');
const supertest = await import('supertest');

// Remplacer '../app' par le chemin réel vers votre fichier d'application Express
const app = (await import('../server.js')).default; // Ajustez selon l'exportation de votre fichier app.js
const request = supertest(app);

describe('API Test Suite', function() {
    it('Step 1: Create a User', async function() {
        const response = await request.post('/api/auth/register').send({
            name: "userTest",
            email: "mailTest@hotmail.fr",
            password: "passwordTest"
        });
        expect(response.status).to.equal(200);
        // Assurez-vous de vérifier d'autres propriétés de la réponse si nécessaire
    });

    it('Step 2: Update a User', async function() {
        const response = await request.put('/api/auth/users/65d4b3d0e6ae0f772c54f2c2').send({
            name: "userTestUpdated",
            email: "mailTestUpdate@hotmail.fr",
            password: "passwordTestNew"
        });
        expect(response.status).to.equal(200);
    });

    it('Step 3: Delete a User', async function() {
        const response = await request.delete('/api/auth/users/65d4b3d0e6ae0f772c54f2c8');
        expect(response.status).to.equal(200);
    });

    it('Step 4: Create a Catway', async function() {
        const response = await request.post('/api/catways/').send({
            catwayNumber: "12",
            type: "long",
            catwayState: "clean"
        });
        expect(response.status).to.equal(200);
    });

    it('Step 5: Update a Catway', async function() {
        const response = await request.put('/api/catways/65d4b77569c4ff7b8dc2ecec').send({
            catwayState: "testClean"
        });
        expect(response.status).to.equal(200);
    });

    it('Step 6: Delete a Catway', async function() {
        const response = await request.delete('/api/catways/65d4b77b69c4ff7b8dc2ecee');
        expect(response.status).to.equal(200);
    });

    it('Step 7: Get Catway Details', async function() {
        const response = await request.get('/api/catways/65d4b77569c4ff7b8dc2ecec');
        expect(response.status).to.equal(200);
        // Vérifiez ici les détails spécifiques du catway si nécessaire
    });

    it('Step 8: Create a Reservation', async function() {
        const response = await request.post('/api/reservations/catways/1/reservations').send({
            clientName: "alix",
            boatName: "boatTest",
            checkIn: "2023-01-01",
            checkOut: "2023-01-07"
        });
        expect(response.status).to.equal(200);
    });

    it('Step 9: Get Reservation Details', async function() {
        const response = await request.get('/api/reservations/65d4b8e569c4ff7b8dc2ecf4');
        expect(response.status).to.equal(200);
        // Vérifiez ici les détails spécifiques de la réservation si nécessaire
    });

    it('Step 10: Delete a Reservation', async function() {
        const response = await request.delete('/api/reservations/65d4b92669c4ff7b8dc2ecfa');
        expect(response.status).to.equal(200);
    });
});
